    <>
      <h2>ContextQ1Detail2</h2>
      <button
        onClick={() => {
          handleButtonClick();
          toggleModalOpen();
        }}
      >
        {isModalOpen ? "숨기기" : "보이기"}
      </button>
    </>
  );
};
export default ContextQ1Detail2;
